import React, { useEffect } from "react";
import { MapContainer, TileLayer, ZoomControl } from "react-leaflet";
import { PageContainer } from "./styles/solution_style.js";
import L from "leaflet";
import "leaflet-openweathermap-master";

function Solution() {
  useEffect(() => {
    var osm = L.tileLayer(
      "https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png",
      {
        maxZoom: 18,
        attribution: "[insert correct attribution here!]",
      }
    );

    var clouds = L.OWM.clouds({
      showLegend: false,
      opacity: 0.5,
      appId: "e6d8c9c20269bd6d193a610ab4f7d761",
    });
    var city = L.OWM.current({ intervall: 15, lang: "de" });

    var map = L.map("map", {
      center: new L.LatLng(51.5, 10),
      zoom: 10,
      layers: [osm],
    });
    var baseMaps = { "OSM Standard": osm };
    var overlayMaps = { Clouds: clouds, Cities: city };
    var layerControl = L.control.layers(baseMaps, overlayMaps).addTo(map);
  }, []);

  return (
    <PageContainer>
      <MapContainer
        center={[39.1, -76.1]}
        zoom={10}
        scrollWheelZoom={true}
        zoomControl={false}
      >
        <TileLayer
          url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
          attribution='&copy; <a href="http://osm.org/copyright">'
        />
        <ZoomControl position="topright" />
      </MapContainer>
    </PageContainer>
  );
}

export default Solution;
